<p class="c3"><span class="c49"></span></p>
<p class="c3"><span class="c49"></span></p>
<p class="c41 c23"><span class="c21">Dans les cas o la TVA sur loyer est encaisse par la banque ou paye par chques et sous rserve de l'encaissement effectif, INVESTIS DOM SAS ne prlvera pas les sommes dues  ce titre.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">Si la Cotisation Foncire des Entreprises et taxes annexes sont payes par chque, sous rserve du paiement effectif du chque, INVESTIS DOM SAS ne prlvera pas les sommes dues  ce titre.</span>
</p>
<p class="c41 c36"><span class="c21"></span></p>
<p class="c23 c41"><span class="c21">Tous frais, taxes, impts de toute nature, prsents ou  venir, notamment la Cotisation Foncire des Entreprises et Taxes Annexes (ex Taxe Professionnelle) dont le LOUEUR serait redevable, seront  la charge exclusive du LOCATAIRE.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">En cas de retard dans le paiement de toute somme due par le LOCATAIRE, le LOUEUR se rserve la facult d'exiger le versement d'une indemnit de retard gale  1,5% des sommes dues par mois de retard qui s'ajoutent aux intrts de retard prvus  l'article 8 du contrat de location. Une somme forfaitaire de 100  HT sera facture par loyer impay, en sus des autres frais et intrts de retard mentionns prcdemment. Tout mois commenc est d intgralement.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">Les informations contenues dans le prsent mandat, qui doit tre complt, sont destines  ntre utilises par le crancier que pour la gestion de sa relation avec son client. Elles pourront donner lieu  lexercice, par ce dernier, de ses droits doppositions, daccs et de rectification tels que prvus aux articles 38 et suivants de la loi n78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts.</span><a
        id="id.1fob9te"></a></p>
